import React from "react";

export default function ComboBox({contents,width}) {
  return (
    <div className={`flex h-6 my-1 border text-ssx items-center bg-white ${width}`}>
      <select className={ `inline-block h-2 w-full ` } name="month">
        {contents.map((data)=>
            <option value={data.value}>{data.face}</option>   
        )}
      </select>
    </div>
  );
}
